<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Creaci√≥n de Plantillas</title>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.16.105/pdf.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/konva@9/konva.min.js"></script>
    <style>
        #pdf-container {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 20px;
            margin: 20px;
        }

        .page-container {
            position: relative;
            border: 1px solid #ddd;
            margin: 10px 0;
        }

        canvas {
            border: 1px solid black;
            display: block;
        }

        .konva-container {
            position: absolute;
            top: 0;
            left: 0;
        }

        .toolbar {
            text-align: center;
            margin-bottom: 10px;
            position: relative;
            z-index: 1000;
        }
    </style>
</head>

<body>
    <div id="pdf-container"></div>

    <script>
        const pdfUrl = "/storage/demo.pdf";
        const pdfContainer = document.getElementById("pdf-container");
        const annotationsData = {
            1: [{
                    height: 126.46753806904026,
                    rotation: 0,
                    type: "image",
                    src: "data:image/png;base64,",
                    width: 221.46753806904016,
                    x: 654.9999999999993,
                    y: 213.99999999999926,
                },
                {
                    height: 178.67568385205644,
                    rotation: 0,
                    type: "image",
                    src: "data:image/png;base64,",
                    width: 178.67568385205652,
                    x: 161.3243161479435,
                    y: 86.32431614794393,
                },
            ]
        };

        async function loadPDF(pdfUrl) {
            const pdfDoc = await pdfjsLib.getDocument(pdfUrl).promise;
            for (let pageNum = 1; pageNum <= pdfDoc.numPages; pageNum++) {
                await renderPage(pdfDoc, pageNum);
            }
        }

        async function renderPage(pdfDoc, pageNum) {
            const page = await pdfDoc.getPage(pageNum);
            const viewport = page.getViewport({
                scale: 1.5
            });

            const pageContainer = document.createElement("div");
            pageContainer.classList.add("page-container");
            pageContainer.style.width = `${viewport.width}px`;
            pageContainer.style.height = `${viewport.height + 40}px`;
            pdfContainer.appendChild(pageContainer);

            const pdfCanvas = document.createElement("canvas");
            const pdfContext = pdfCanvas.getContext("2d");
            pdfCanvas.width = viewport.width;
            pdfCanvas.height = viewport.height;
            pageContainer.appendChild(pdfCanvas);

            const konvaContainer = document.createElement("div");
            konvaContainer.classList.add("konva-container");
            konvaContainer.style.width = `${viewport.width}px`;
            konvaContainer.style.height = `${viewport.height}px`;
            pageContainer.appendChild(konvaContainer);

            const toolbar = document.createElement("div");
            toolbar.classList.add("toolbar");
            toolbar.innerHTML = `<button id="add-annotation-btn-${pageNum}">Agregar Imagen</button>`;
            pageContainer.prepend(toolbar);

            await page.render({
                canvasContext: pdfContext,
                viewport: viewport
            }).promise;

            setupKonvaForPage(konvaContainer, pageNum, viewport);
        }

        function setupKonvaForPage(container, pageNum, viewport) {
            const stage = new Konva.Stage({
                container: container,
                width: viewport.width,
                height: viewport.height,
            });

            const annotationLayer = new Konva.Layer();
            stage.add(annotationLayer);

            const transformer = new Konva.Transformer({
                padding: 5,
                enabled: false, // Deshabilitar la capacidad de transformar (incluso mover)
                rotateEnabled: false, // Deshabilitar rotaci√≥n
                scaleEnabled: false, // Deshabilitar redimensionamiento
            });
            annotationLayer.add(transformer);

            if (!annotationsData[pageNum]) {
                annotationsData[pageNum] = [];
            }

            // Renderizar anotaciones precargadas
            annotationsData[pageNum].forEach(data => {
                if (data.type === 'image') {
                    const annotation = createImageAnnotation(data, annotationLayer);
                    annotationLayer.add(annotation);
                }
            });

            annotationLayer.draw();

            stage.on("click", (e) => {
                if (e.target === stage) {
                    transformer.nodes([]);
                    annotationLayer.batchDraw();
                } else {
                    transformer.nodes([e.target]);
                    annotationLayer.batchDraw();
                }
            });
        }

        function createImageAnnotation(data, layer) {
            const img = new Image();
            img.src = data.src;

            const annotation = new Konva.Image({
                x: data.x,
                y: data.y,
                image: img,
                width: data.width,
                height: data.height,
                draggable: false, // Desactivar la capacidad de mover
                isTransformable: false, // Evitar transformaci√≥n (escalar, rotar, etc.)
                listening: false, // Desactivar eventos de escucha (evita la manipulaci√≥n)
            });

            // Deshabilitar interacciones adicionales:
            annotation.cache(); // Usamos `cache` para mejorar el rendimiento
            annotation.filters([]); // No aplicar filtros para evitar transformaciones

            return annotation;
        }

        async function loadImageFromFile(file) {
            return new Promise((resolve, reject) => {
                const reader = new FileReader();
                reader.onload = () => {
                    const img = new Image();
                    img.src = reader.result;
                    img.onload = () => resolve(img);
                    img.onerror = reject;
                };
                reader.onerror = reject;
                reader.readAsDataURL(file);
            });
        }

        loadPDF(pdfUrl);
    </script>
</body>

</html>
